        let token;
        let data = await AuthRepository.findOne(email);
        if(data) {
            let x= await bcrypt.compare(password, data.password);
            if(x) {
                token= jwt.sign({
                    id : data._id
                }, JWT_SECRET)
                return {
                    status: 200,
                    _id: data._id
                };
            }
            else {
                return {
                    status: 401,
                    message: "Psw saiiiiii"
                };
            }
        }
        else {
            return {
                status: 401,
                message: "Email unvalidate"
            }
        }
